console.log("Esto es una modificación");

function App() {
  return (
    <div className={styleApp} style={{ padding: "25px" }}>
      <div className={style.nav}>
        <SearchBar onSearch={(characterID) => window.alert(characterID)} />
      </div>
      <div>
        <Cards characters={characters} />
      </div>
    </div>
  );
}

export default App;
